import collectionsclass Solution:    def subsetsWithDup(self, nums):        self.res = []        self.dict=[]        self.dfs(nums, [])        return self.res    def dfs(self, nums, path):        if not nums:            c=collections.Counter(path)            if path not in self.res and c not in self.dict:                self.res.append(path)                self.dict.append(c)            return        self.dfs(nums[1:], path)        self.dfs(nums[1:], path+[nums[0]])s=Solution()nums=[4,4,4,1,4]print(s.subsetsWithDup(nums))